import './App.css';
import { useEffect, useState } from 'react';
import axios from "axios"
import Formtable from './components/Formtable';

function App() {
  const [addSection,setAddSection] = useState(false)
  const [editSection,setEditSection] = useState(false)
  const [formData,setFormData] = useState({
    id: "",
    name: "",
    image: "",
  })
  const [formDataEdit,setFormDataEdit] = useState({
    id: "",
    name: "",
    image: "",
  })
  const [dataList,setDataList] = useState([])

  const handleOnChange = (e)=>{
    const {value,name} = e.target
    setFormData((preve)=>{
        return{
          ...preve,
          [name] : value
        }
    })
  }


  const handleSubmit = async(e)=>{
      e.preventDefault()
      const data = await axios.post("http://localhost:5555/addRooms",formData)
      console.log(data)
      if(data.data.success){
          setAddSection(false)
          alert(data.data.message)
          getFetchData()
          setFormData({
            id: "",
            name: "",
            image: "",
          })

      }
  }
  // const getFetchData = async()=>{
  //   const data = await axios.get("http://localhost:5555/getRooms")
  //   console.log(data)
  //   if(data.data.success){
  //       setDataList(data.data.data)
  //   }
  // }
  // useEffect(()=>{
  //   getFetchData()
  // },[])

  const getFetchData = async () => {
    try {
        const response = await axios.get("http://localhost:5555/getRooms");
        console.log(response.data);
        if (response.data.success) {
            setDataList(response.data.data);
        }
    } catch (error) {
        console.error("Lỗi khi lấy dữ liệu:", error);
    }
};

useEffect(() => {
    getFetchData();
}, []);



  const handleDelete = async (id) => {
    const data = await axios.delete("http://localhost:5555/deleteRooms/" + id);
    if (data.data.success) {
      getFetchData();
      alert(data.data.message);
    }
  };

  const handleUpdate = async(e, id)=>{
    e.preventDefault()
    const data = await axios.put("http://localhost:8090/api/updateHouse/" + id,formDataEdit)
    if(data.data.success){
      getFetchData()
      alert(data.data.message)
      setEditSection(false)
    }
  }
  const handleEditOnChange = async(e)=>{
    const {value,name} = e.target
    setFormDataEdit((preve)=>{
        return{
          ...preve,
          [name] : value
        }
    })
  }
  const handleEdit = (el)=>{
    setFormDataEdit(el)
    setEditSection(true)
  }
  return (
   <>
      <div className="container">
        <button className="btn btn-add" onClick={()=>setAddSection(true)}>Add</button>

      {
        addSection && (
          <Formtable
            handleSubmit={handleSubmit}
            handleOnChange={handleOnChange}
            handleclose = {()=>setAddSection(false)}
            rest={formData}
          />
        )
      }
      {
        editSection && (
          <Formtable
            handleSubmit={handleUpdate}
            handleOnChange={handleEditOnChange}
            handleclose = {()=>setEditSection(false)}
            rest={formDataEdit}
          />
        )
      }


      <div className='tableContainer'>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Image</th>
              <th>
              
              </th>
            </tr>
          </thead>
          <tbody>
            { dataList[0] ? (
              dataList.map((el)=>{
                console.log(el)
                return(
                  <tr>
                    <td>{el.id}</td>
                    <td>{el.name}</td>
                    <td>{el.image}</td>
                    <td>
                      <button className='btn btn-edit' onClick={()=>handleEdit(el)}>Edit</button>
                      <button className='btn btn-delete' onClick={()=>handleDelete(el.RoomCode)}>Delete</button>
                    </td>
                  </tr>
                )
              }))
              : (
                <tr>
                <td  style={{textAlign : "center"}}>No data</td>
                </tr>
              )
            }
          </tbody>
        </table>
      </div>
     


      </div>
   </>
  );
}

export default App;
